        59: {
          body: 'NestJS',
          breadcrumbs: 'Framework Modules » Frameworks',
          id: '59',
          title: 'Frameworks',
        },
        6: {
          body: "All @forts/resiliencets decorators are backended by the ResilienceProviderService class, which is responsible for providing a unified interface for interacting with the underlying logging and persistence mechanisms. The ResilienceProviderService needs to be initialized prior to using any of the decorators. This can be done by calling the ResilienceProviderService.forRoot, method, which takes in a ResilienceConfig object, or by defining a resilience.toml file in the root of your project. Example resilience.toml file: [resilience]\nserviceName = \"my-service\"\ncollectResourceUsage = true\nobservationInterval = 3000\nmaxUtilization = 0.9\nmaxSafeUtilization = 0.75\nmaxCpuUtilization = 0.9\nmaxSafeCpuUtilization = 0.75\ndelimiter = \"::\" [redis]\nredisHost = \"localhost\"\nredisPort = 6379\nredisPrefix = \"local\"\nmaxConnectionAttempts = 100\nmaxBackoff = 3000\nmaxIncrBackoff = 500 Example ResilienceConfig object: type ResilienceConfig = { resilience: { serviceName: string; serviceVersion?: string; delimiter?: string; collectResourceUsage?: boolean; observationInterval?: number; maxUtilization?: number; maxSafeUtilization?: number; maxCpuUtilization?: number; maxSafeCpuUtilization?: number; }; redis: { redisHost: string; redisPort: number; redisPassword?: string; redisUser?: string; redisPrefix?: string; maxConnectionAttempts?: number; maxBackoff?: number; maxIncrBackoff?: number; rejectUnauthorized?: boolean; useTls?: boolean;\n};\n}; Example ResilienceProviderService.forRoot call: import { ResilienceProviderService } from '@forts/resilience4ts-core'; async function bootstrap() { svc = ResilienceProviderService.forRoot({ resilience: { serviceName: 'r4t-test', }, redis: { redisHost: 'localhost', redisPort: 6379, redisPassword: 'pwd', redisUser: 'user', redisPrefix: 'r4t-test', }, }); await svc.start();\n} bootstrap();",
          breadcrumbs: 'Getting Started » Core Concepts » Core Configuration',
          id: '6',
          title: 'Core Configuration',
        },
        60: {
          body: 'Getting started with resilience4ts + NestJS',
          breadcrumbs: 'Framework Modules » NestJS » @forts/resilience4ts-nestjs',
          id: '60',
          title: '@forts/resilience4ts-nestjs',
        },
        61: {
          body: 'While resilience4ts works well as a standalone library, it also provides a set of decorators for NestJS. These decorators can be used to decorate any NestJS controller or service method. @forts/resilience4ts-nestjs wraps all the core resilience4ts decorators plus the @forts/resilience4ts-all decorator into a single package, and re-exports all of them along with convenient method decorators for use with NestJS controllers and services.',
          breadcrumbs: 'Framework Modules » NestJS » Introduction',
          id: '61',
          title: 'Introduction',
        },
        62: {
          body: 'npm i @forts/resilience4ts-nestjs',
          breadcrumbs: 'Framework Modules » NestJS » Installation',
          id: '62',
          title: 'Installation',
        },
        63: {
          body: "Taken from the NestJS example import { Bulkhead, CircuitBreaker, Fallback, CircuitBreakerImpl, CircuitBreakerStrategy,\n} from '@forts/resilience4ts-nestjs';\nimport { Inject, Injectable, UnauthorizedException } from '@nestjs/common';\nimport { AppGateway } from './app.gateway'; type HelloWorldArgs = { id: string;\n}; @Injectable()\nexport class AppService { constructor( @Inject('AppGateway') private readonly appGateway: AppGateway, ) {} // decorators can be stacked, and will be applied in the order they are listed @Bulkhead({ getUniqueId: (args: HelloWorldArgs) => args.id, maxConcurrent: 1, maxWait: 250, }) @Fallback({ shouldHandle: new PredicateBuilder(UnauthorizedException).or( (e: Error) => e.message === 'asdf', ), fallbackAction: async () => 'fallback', }) @CircuitBreaker({ strategy: CircuitBreakerStrategy.Percentage, threshold: 0.2, }) async getHello(args: Record<'id', string>) { // The original, functional decorators are also available // To use them import them as their name + Impl // e.g. CircuitBreakerImpl, CacheImpl, etc. return await CircuitBreakerImpl.of('gateway.call', { strategy: CircuitBreakerStrategy.Percentage, threshold: 0.2, }).on(this.appGateway.getHello)(args); }\n}",
          breadcrumbs:
            'Framework Modules » NestJS » Adding Decorators to a NestJS Injectable Service',
          id: '63',
          title: 'Adding Decorators to a NestJS Injectable Service',
        },
        7: {
          body: "A PredicateBuilder is a function that takes in a Predicate and returns a Predicate. A Predicate is a function that takes in a Context and returns a boolean. In the context of a resilience4ts decorator, the Context is typically the result of the decorated function. PredicateBuilders are commonly used to create Predicates that check the result of the decorated function for a certain value, or to check the Context for a certain value. An example of this can be found in the @forts/resilience4ts-fallback module, where the optional shouldHandle property on the Fallback decorator config takes a PredicateBuilder to determine whether or not the fallback action should be executed based on the result of the decorated function. import { PredicateBuilder, OperationCancelledException\n} from '@forts/resilience4ts-core';\nimport { Fallback } from '@forts/resilience4ts-fallback'; const fallback = Fallback.of('my-fallback', { shouldHandle: new PredicateBuilder() .isnot(OperationCancelledException), fallbackAction: () => 'fallback',\n}); const result = await fallback.on(async () => { // do something\n})();",
          breadcrumbs: 'Getting Started » Core Concepts » PredicateBuilder',
          id: '7',
          title: 'PredicateBuilder',
        },
